import React, { Component } from 'react';

class Pokedex extends Component {
  render() {
    const { name, type, image, weight } = this.props;
    return <div className='div-podemon'>
      <div className='info'>
        <p>{name}</p>
        <p>{type}</p>
        <p>averageWeight: {weight}</p>
      </div>
    </div>
  }
}

export default Pokedex;
